                    <img src={cart.product.imageUrl} alt={cart.id}/>
                </td>
                <td>{cart.product.name}</td>
                <td>${cart.product.price}</td>
                <td>2</td>
                <td>
                    <span className="badge success">...</span>
                </td>
            </tr>
        </>
    )
}

export default CartItem;
